import React from 'react'

class Result extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      patronous: 
      [
        [5, 2, 2, 2],
        [3, 1, 3, 3],
        [2, 2, 2, 2],
        [3, 4, 1, 3],
        [5, 5, 3, 2],
        [5, 2, 5, 5],
        [5, 3, 5, 1]
      ],
      newScore: []
    }
  }

  componentDidUpdate() {
    let userScore = this.props.userScore
    for(let i = 0; i < userScore.length; i++){
      console.log(userScore[i] - this.state.patronous[i][i])
    }
  }

  render() {
    return(
      <h3>{this.props.userScore}</h3>
    )
  }
}

export default Result
